import "./Cuisines_header.css"
const CuisinesHeader = () => {

    return(
        <section className="which-food">
            <h1>غذا چه میل دارید?</h1>
            <h2>صبحانه، ناهار، شام یا هر چیزی که میل دارید را انتخاب کنید</h2>
            
        </section>
    )}
export default CuisinesHeader;
